import React from "react";

const SquareOfCheckboxTable = () => {
  const rows = 10;
  const columns = 10;

  return (
    <table>
      <thead>
        <tr>
          <th>Square of Checkbox</th>
        </tr>
      </thead>
      <tbody>
        {Array.from({ length: rows }, (_, i) => (
          <tr>
            {Array.from({ length: columns }, (_, j) => (
              <td>
                <input type="checkbox" id={`${i}_${j}`} value={`${i}_${j}`} />
              </td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default SquareOfCheckboxTable;
